Character classes
Some character classes are used so commonly that they get their own shortcut. You‚Äôve already seen ., which matches any character apart from a newline. There are three other particularly useful pairs:

\d matches any digit;
\D matches anything that isn‚Äôt a digit.
\s matches any whitespace (e.g., space, tab, newline);
\S matches anything that isn‚Äôt whitespace.
\w matches any ‚Äúword‚Äù character, i.e.¬†letters and numbers;
\W matches any ‚Äúnon-word‚Äù character.

